import React from 'react';
import {Router, Route, Switch} from 'react-router-dom';

import history from '../history';
import PostList from './timestamps/PostList';
import PostCreate from './timestamps/PostCreate';
import Header from './Header';

const App = () => {
    return (
        <div className={`ui container`}>
            <Router history={history}>
                <div>
                    <Header/>
                    <Switch>
                        <Route path={`/blog/list`} exact component={PostList}/>
                        <Route path={`/blog/new`} component={PostCreate}/>
                    </Switch>
                    {this.renderCreate()}
                </div>
            </Router>
        </div>
    )
};

export default App;
